import React, { Component } from "react";

class catchPokemon extends Component {
	constructor(props) {
	  super(props);
	}
	render() { 
	  return ( 
		<div className="mb-4">
		<button
		  className="btn btn-warning"
		  onClick={this.createPokemon}
		>
		  Catch Pokemon
		</button>
		</div>

	  );
	}
}

export default catchPokemon;
